    { title: hello },
    { title: hello },
    { title: hello },
    { title: hello },
    { title: hello },
    { title: hello },
  ];

  return (
    <div className="journal">
      {/* {journal !== "" &&
        journal.map((entry, i) => <div key={i}>{entry.title}</div>)} */}
      {test.map((entry, i) => (
        <div key={i}>{entry.title}</div>
      ))}
    </div>
  );
};

export default Journal;
